import React from 'react';
import { HashRouter, Route, Routes, Navigate } from 'react-router-dom';
import Header from './Header';
import NavBar from './NavBar';
import Home from './Home';
import About from './About';
import Resources from './Resources';
import Unit from './Unit';
import Page from './Page';
import CustomLink from './CustomLink'
import { topics } from './Topics';
import './App.css';
import subUnitList from './SubUnitList'
import subUnitRoutes from './SubUnitRoutes'

function App() {
  const subUnitRoutes = 
  topics.map((list, unitIndex) => (
    <Routes>
      {list.map((title, subUnitIndex) => (
        <Route path={`/unit${unitIndex + 1}/${subUnitIndex + 1}`} 
          element={<Page unit={unitIndex + 1} index={subUnitIndex + 1} title={title}/>}>
        </Route>))}
    </Routes>));

  return (
    <div className="app">
      <HashRouter>
        <Header />
        <NavBar />
        <Routes>
          <Route path="/" element={<Navigate to="/home" />} />
          <Route path="/home" element={<Home />} />
          <Route path="/about" element={<About />} />
          <Route path="/resources" element={<Resources />} />
          {subUnitList}
        </Routes>
        {subUnitRoutes}
      </HashRouter>
    </div>
  );
}
export default App;
